Knight and Day (2010) 

Verenigde Staten
Actie / Komedie
110 minuten

geregisseerd door James Mangold
met Tom Cruise, Cameron Diaz en Maggie Grace

'Knight &amp; Day' gaat over de eenzame vrouw June (Cameron Diaz), wier ogenschijnlijk onschuldige blind date haar leven op zijn kop zet. De blind date, een superspion genaamd Milner (Tom Cruise), neemt haar mee op een gewelddadige wereldreis om een batterij te beschermen die de sleutel bevat tot een oneindige krachtbron.

